import { NavBar } from './components/NavBar';

function App() {
  const links = [
    { label: 'Link A', path: ''},
    { label: 'Link b', path: ''},
    { label: 'Link c', path: ''},
    { label: 'Link d', path: ''},
    { label: 'Link d', path: ''},
    { label: 'Link d', path: ''}
  ]
  const user = { fullName: 'John Doe', job: 'dev', profilePicture: 'assets/pp.png' }

  return (
    <div className='h-screen w-screen'>
      <body>
        <NavBar links={links} user={user} />
        <div className='h-[calc(100vh-64px)] w-fit bg-white text-[#868e97]  flex flex-col justify-content-center justify-between text-center overflow-auto'>
          <div className='w-screen py-6 px-12 border'>
            <p className='text-4xl font-semibold text-gray-800'>{links[0].label}</p>
          </div>
        </div>
      </body>
    </div>
  );
}

export default App;
